import styled from 'styled-components';
import SideBar from '../../common/sideBar';
export const Div0 = styled.div`
    width: 100%;
    margin: 0 auto;
    height:100vh;
    overflow: hidden;
    max-width: 1920px;
    display:grid;
    grid-template-columns: 230px 1fr;

`
export const SideBarDiv =styled.div`
    border-right:gray 2px solid;
    overflow:auto;
    scrollbar-arrow-color: #f4ae21; /**//*三角箭頭的顏色*/
    scrollbar-face-color: #333; /**//*立體滾動條的顏色*/
    scrollbar-3dlight-color: #666; /**//*立體滾動條亮邊的顏
    色*/
    scrollbar-highlight-color: #666; /**//*滾動條空白部分的
    顏色*/
    scrollbar-shadow-color: #999; /**//*立體滾動條陰影的顏
    色*/
    scrollbar-darkshadow-color: #666; /**//*立體滾動條強陰
    影的顏色*/
    scrollbar-track-color: #666; /**//*立體滾動條背景顏色*/
    scrollbar-base-color:#f8f8f8; /**//*滾動條的基本顏色*/
    Cursor:url(mouse.cur); /**//*自定義個性滑鼠*/
`
export const ContentDiv =styled.div`
    background-color:white;
    overflow:auto;
    
`
export const DataInfoChooseDiv =styled.div`
    background-color:black;
    height:85px;
`
export const DataInfoDiv =styled.div`
    background-color:red;
    height:200px;
    padding:20px
`
export const DataDrawDiv =styled.div`
    background-color:blue;
    height:45%;
    padding:30px;
    min-height:250px;
    
`
export const DataListDiv =styled.div`
    background-color:green;
    height:400px;
`
